import Header from './Header'

const layoutStyle = {
  margin: 20,
  padding: 20,
  align: center,
  border: '1px solid #DDD'
}

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
  </div>
)

export default Layout
